import React, { Component } from 'react';
import { Link } from "react-router-dom";



class Nav extends Component {
    render() {
        return (

            <div className="row menuSegundario">
                <div className="col-12 justify-content-center my-2 d-flex">
                    <nav className="nav flex-column">
                        <Link to={'/inicio'}> <a className="btn btn-success bg-success text-white mb-1">Pasteles</a> </Link>
                        <Link to={'/inicio'}> <a className="btn btn-success bg-success text-white mb-1">Galletas</a> </Link>
                        <Link to={'/inicio'}> <a className="btn btn-success bg-success text-white mb-1">Cremas Dulces </a></Link>
                        <Link to={'/inicio'}> <a className="btn btn-success bg-success text-white mb-1">Bizcochos</a> </Link>
                        <Link to={'/inicio'}> <a className="btn btn-success bg-success text-white mb-1">Magdalenas </a></Link>
                        <Link to={'/inicio'}> <a className="btn btn-success bg-success text-white mb-1">Mousse</a></Link>
                        <Link to={'/inicio'}> <a className="btn btn-success bg-success text-white">Recetas Faciles </a></Link>
                    </nav>
                </div>
            </div>
        )
    }
}

export default Nav;
